import styled from "styled-components/native"

export const FirstFoodImage = styled.ImageBackground`
flex: 3;
margin-top: 28px;
height: 256px;
padding: 2px;
padding-bottom: 0px;
position: relative;
justify-content: flex-end;
`;

export const SecondFoodImage = styled.ImageBackground`
flex: 1;
height: 256px;
padding: 2px;
position: relative;
`;

export const ThirdFoodImage = styled.ImageBackground`
flex: 2;
height: 256px;
padding: 2px;
position: relative;
`;

export const FourthFoodImage = styled.ImageBackground`
flex: 1;
height: 107px;
padding: 2px;
`;

export const FifthFoodImage = styled.ImageBackground`
flex: 1;
height: 107px;
padding: 2px;
`;

export const SixthFoodImage = styled.ImageBackground`
flex: 1;
height: 107px;
padding: 2px;
`;

export const SeventhFoodImage = styled.ImageBackground`
flex: 1;
height: 107px;
padding: 2px;

`;

export const EightFoodImage = styled.ImageBackground`
flex: 1;
height: 181px;
padding: 2px;

`;

export const NinthFoodImage = styled.ImageBackground`
flex: 2;
height: 181px;
`;

export const CircleBox = styled.View`
width: 32px;
height: 32px;
background-color: #C4C4C4;
border-radius: 100px;
`
export const SmallTxt = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 900;
font-size: 14px;
line-height: 16px;
letter-spacing: -0.333333px;
color: #FFFFFF;
`;

export const ChisaiTxt = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 900;
font-size: 12px;
line-height: 14px;
letter-spacing: -0.333333px;
color: #FFFFFF;
margin-top: 2px;
`;
